Plot: After outlaw leader Ben Wade is captured in a small town, his gang continue to threaten. Small-time rancher Dan Evans is persuaded to take Wade in secret to the nearest town with a railway station to await the train to the court at Yuma. Once the two are holed up in the hotel to wait it becomes apparent the secret is out, and a battle of wills starts.
